A mysterious Irishman, Finian, and his beautiful daughter Sharon, arrive one
day in Rainbow Valley, a small Southern town of tobacco sharecroppers in the
mythical state of Missitucky. The town has its own resident dreamer, Woody
Mahoney, who thinks that he might be able to put the town on the map by
crossing mint with tobacco so that it'll grow already mentholated. Finian's
come to the town because he's stolen a leprechaun's crock of gold and plans to
plant it in the ground so it'll grow faster (or else why would the Americans
have rushed to dig the gold out of California only to plant it back in the
ground at Fort Knox?). But trouble arrives in the form of Og the leprechaun,
who has followed Finian to America and is bent on retrieving his gold.

